      //   <Link to="/form" className="item">
      //     Add Client
      //   </Link>
      //   <div className="right menu">
      //     <Link className="ui item">Calendar</Link>
      //     <Link className="ui item">Logout</Link>
      //   </div>
      // </div>
    );
  }
}

export default CustomNav;
